import Card from '../Card/Card.jsx';
import style from './Cards.module.css';

export default function Cards(props) {
   const { characters, onClose } = props;
   return (
      <div className={style.Cartas}>
      {characters.map((e) => (
          <Card 
          id={e.id}
          name={e.name}
          species={e.species}
          gender={e.gender} 
          image={e.image} 
          onClose={onClose}
          />
          ))}
   </div> 
   );
}
